  \"2015-11-21T10:35:55.560112\",\n\t\"name\": \"disability-research-file-drf\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Disability Research File (DRF) contains
  ten years' worth of Title II and Title XVI disability information extracted from
  a wide variety of sources. Based on calendar-year cohorts of disability applications,
  the DRF contains claim outcomes at every adjudicative level as well as claim details
  for each of the approximately 2.5 million individual claims each year in that ten-year
  period.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\": [{\n\t\t\"key\":
